<template>
  <div class="section-sticky">
    <div class="content" id="top" :class="{higherTop: hasSecondTab}">
      <div class="banner">
      </div>
      <van-sticky>
        <div class="header" :class="{secondTab: hasSecondTab}">
          <div v-for="(item, index) in tabListShow" v-if="tabRowShow===0" class="tab-item" :class="{tabActive: index===tabActiveIndex}" @click="changeShow(index)">
            <span>{{item}}</span>
            <div v-if="index===tabActiveIndex" class="active-line"></div>
          </div>
          <div class="sub-tab-scroll">
            <div v-if="hasSecondTab" class="sub-tab">
              <div
                v-for="(item,index) in subTabList"
                class="sub-tab-item"
                :class="{subActive: index===subTabActiveIndex}"
                @click="changeSubTab(index)">{{item}}</div>
            </div>
          </div>
        </div>
      </van-sticky>
      <div class="clear-both"></div>
      <!--<div class="tab-content">-->
      <cultural v-if="tabActiveIndex===0" :tabData="tabData"></cultural>
      <travel v-if="tabActiveIndex===1" :tabData="tabData"></travel>
      <!--</div>-->
    </div>

  </div>
</template>

<script>
  // import PreschoolEducation from "./preschool-education";
  // import CompulsoryEducation from "./compulsory-education";
  // import HighSchoolEducation from "./high-school-education";
  // import HumanResources from "./human-resources";
  import {getDataByTabName} from "../../api/h5-chart";
  import Notify from "vant/es/notify";
  // import SpecialEducation from "./special-education";
  // import HigherEducation from "./higher-education";
  import Cultural from "./cultural"
  import Travel from "./travel"

  import {remToPx, windowScroll} from '../../libs/util';

  export default {
    name: "index",
    components: {Cultural, Travel},
    data() {
      return {
        // 是否有二级tab页
        hasSecondTab: false,
        tabListText: [
          { text: '文化', value: 0 },
          { text: '旅游', value: 1 }
        ],
        // 当前显示的tab页
        tabListShow: [],
        // 当前显示的tab页是第几行
        tabRowShow: '',
        tabActiveIndex: '',
        subTabList: [],
        subTabActiveIndex: '',
        tabData: {},
        // 学前教育
        preschoolData: [],
        // 九年义务教育
        compulsoryData: [],
        // 高中阶段教育
        highschoolData: [],
        loadDataFinish: false,
        subIndexOffset: []
      }
    },
    mounted() {
      this.initDOM();
      this.changeShow(0);
      // 添加屏幕滚动的监听
      window.addEventListener("scroll", this.handleScroll);
    },
    beforeDestroy() {
      // 销毁已创建的监听
      window.removeEventListener('scroll', this.handleScroll);
    },
    methods: {
      initDOM() {
        document.getElementById("top").scrollIntoView(true);
        this.tabRowShow = 0;
        // 初始显示前4个tab页
        this.sliceObject(this.tabListText, 0, 3);
      },

      // 切换tab页时针对每个tab页不同的处理
      changeTab(index) {
        this.tabActiveIndex = index;
        this.subTabList = [];
        let params = {
          name: ''
        }
        if (index===0) {
          params.name = '文化旅游-文化'
        } else {
          params.name = this.tabListText[index].text
        }
        getDataByTabName(params, res => {
          if(res.data) {
            console.log(res.data.data);
            this.tabData = res.data;
            this.judgeHasSubTab(this.tabData.data);
            // 切换tab时获取当前tab页的各标签页高度
            this.setSubTabOffset(index);
          } else {
            Notify({ type: 'danger', message: '获取数据错误' });
          }
        }, err => {
          Notify({ type: 'danger', message: '服务器错误'+err });
        });
      },
      // 判断页面是否含有二级tab页
      judgeHasSubTab(tabData) {
        if (tabData.length > 1) {
          this.hasSecondTab = true;
          tabData.forEach(item => {
            this.subTabList.push(item.name);
          });
        } else {
          this.hasSecondTab = false;
        }
      },
      // 点击Tab页
      changeShow(value) {
        document.getElementById("top").scrollIntoView(true);
        this.tabListShow = [];
        this.subTabActiveIndex = 0;
        this.tabRowShow = 0;
        this.sliceObject(this.tabListText, 0, 3);
        this.changeTab(value);
      },
      // 通过传递的参数，确定当前显示的tab页是哪一部分
      sliceObject(obj, min, max) {
        obj.forEach((item, index) => {
          if (index >= min && index <= max) {
            this.tabListShow.push(item.text);
          }
        })
      },
      setSubTabOffset(value) {
        // 仅对含有二级tab的页面做处理
        if (this.hasSecondTab === true) {
          // 每次先将当前存放高度的数组清空
          this.subIndexOffset[value] = [];
          // 循环当前二级tab
          this.subTabList.forEach((item, index) => {
            // 通过index获取dom的id
            let tabName = index===0?'1stTab':(index===1?'2ndTab':(index===2?'3rdTab':(index+1+'thTab')));
            this.$nextTick(() => {
              // 按照顺序获取每一个tab的高度并push进数组
              let tabDom = document.getElementById(tabName);
              let offset = tabDom.offsetTop;
              this.subIndexOffset[value].push(offset);
            });
          });
        }
      },

      // 点击二级菜单的动作
      changeSubTab(index) {
        // this.subTabActiveIndex = index;
        if (index === 0) {
          this.subTabActiveIndex = index;
          document.getElementById("top").scrollIntoView(true);
        } else {
          windowScroll(index===0?'1stTab':(index===1?'2ndTab':(index===2?'3rdTab':(index+1+'thTab'))));
        }
      },
      // 监听的页面滚动事件
      handleScroll() {
        if (this.hasSecondTab === true) {
          // 获取当前页面已经滚动的高度
          let scrollTop = window.pageYOffset;
          let tabActive = this.tabActiveIndex;
          // 获取当前激活页面的存放二级tab高度的数组
          let tabActiveOffset = this.subIndexOffset[tabActive];
          let arrayLength = tabActiveOffset.length;
          for (let i = 0; i < arrayLength ; i++) {
            // 将数组中的每一个高度与当前滚动的高度作比较，获取当前激活的是哪个tab
            if (tabActive===0) {
              if (scrollTop > (tabActiveOffset[i] - remToPx(30/75))) {
                this.subTabActiveIndex = i;
              }
            } else {
              if (scrollTop > (tabActiveOffset[i] - remToPx(230/75))) {
                this.subTabActiveIndex = i;
              }
            }

          }
        }
      }
    }
  }
</script>
